import React, { Component } from 'react';

class App extends Component {

  render() {
      let mouseCursor = document.getElementById('cursor');
      console.log(mouseCursor);

      // window.addEventListener('mousemove', cursor);

      // function cursor(e) {
      //   console.log(e);

        // mouseCursor.style.top = e.pageY + "px";
        // mouseCursor.style.left = e.pageX + "px";
      // }

    return (
      <div className="App">
      <div id="cursor"></div>
      <div id="bg">
        <div className="slant"></div>
        <div className="slant"></div>
        <div className="slant"></div>
        <div className="slant"></div>
      </div>
      <div id="content">
        <div className="group">
          <h1>Involved Group</h1>
        </div>
        <div className="group">
          <p><b>Label Management</b></p>
          <p><a href="#">Anjunabeats</a></p>
          <p><a href="#">Anjunadeep</a></p>
          <p><a href="#">Reflections</a></p>
          <p><a href="#">This Never Happened</a></p>
        </div>
        <div className="group">
          <p><b>Artist Management</b></p>
          <p><a href="#">Above & Beyond</a></p>
          <p><a href="#">Andrew Bayer</a></p>
          <p><a href="#">Ben Böhmer</a></p>
          <p><a href="#">Dusky</a></p>
          <p><a href="#">GRANT</a></p>
          <p><a href="#">Jason Ross</a></p>
          <p><a href="#">Lane 8</a></p>
          <p><a href="#">Seven Lions</a></p>
          <p><a href="#">Spencer Brown</a></p>
          <p><a href="#">Whose Rules</a></p>
        </div>
        <div className="group">
          <p><b>Publishing</b></p>
          <br></br><br></br>
          <p><b>Design</b></p>
        </div>
        <div className="group contact">
          <p><b>Contact</b></p>
          <p><a href="#">contact@involved-group.com</a></p>
          <p>65 Decima St., London, U.K.</p>
        </div>
      </div>
    </div>
    );
  }
}

export default App;
